    false,nt"url": null,nt"notes": "The purpose of this study was to provide
    the economic analysis needed for the Arrowwood NWR CCP by evaluating the regional
    economic impacts associated with the Arrowwood NWR Draft CCP management strategies.
    This report first provides a description of the local community and economy near
    the Refuge. An analysis of current and proposed management strategies that could
    affect the local economy is then presented. The Refuge management activities of
    economic concern in this analysis are Refuge personnel staffing and Refuge spending
    within the local community, and spending in the local community by Refuge visitors.",nt"license_title":
